	$("#Team-1").on("change" , function() {
		var tmp_team1 = $(this).val();
		var tmp_team2 = $("#Team-2").val();


		$("#form_teams")[0].reset();

		$(this).val(tmp_team1);
		$("#Team-2").val(tmp_team2);

		if(tmp_team1 == "Random"){
			$(player_pos).each(function( index,value_node ) {
				$("#" + value_node + "_team_1").attr("value", $(langArray)[Math.floor(Math.random()*($(langArray).length)-1)]);
				$("#" + value_node + "_team_1_img").show(); 
			        document.getElementById(value_node + "_team_1_img").style.backgroundImage = "url(maillots/" + langArray_nat[langArray.indexOf($("#" + value_node + "_team_1").val())] + ".png)";
			});
		
		}else{
		$(player_pos).each(function( index,value_node ) { 
			$("#" + value_node + "_team_1").attr("value", $(eval("team_" + tmp_team1))[index]);
			if( "#" + value_node + "_team_1" != "Empty"){

                		   $("#" + value_node + "_team_1_img").show();
				   document.getElementById(value_node + "_team_1_img").style.backgroundImage = "url(maillots/" + langArray_nat[langArray.indexOf($("#" + value_node + "_team_1").val())] + ".png)";
		   
             		 }
			else{
                		   $("#" + value_node + "_team_1_img").hide(); 
            		 }
			$("#" + value_node + "_team_1_img").show();
				   document.getElementById(value_node + "_team_1_img").style.backgroundImage = "url(maillots/" + tmp_team1.split("9")[0] + ".png)";
		});

		}
	});

